import React from 'react';
import Header from './Header';
import TopArtists from './TopArtists';
import TopSongs from './TopSongs';
import ListeningStats from './ListeningStats';
import GenreBreakdown from './GenreBreakdown';
import styles from './Wrapped.module.css';

function Wrapped({ data }) {
  return (
    <div className={styles.wrapped}>
      <Header />
      <TopArtists artists={data.topArtists} />
      <TopSongs songs={data.topSongs} />
      <ListeningStats totalMinutes={data.totalMinutes} topGenre={data.topGenre} />
      <GenreBreakdown genres={data.genres} />
    </div>
  );
}

export default Wrapped;
